const Home = () => {

    const getCovidData = async () => {
      const res = await fetch('https://data.covid19india.org/data.json');
      const actualData = await res.json();
      console.log(actualData.statewise[0])
    }
    
    useEffect(() => {
            getCovidData();
    }, []);
    

    return (
        <>
            <section className="container-fluid">
                <div className="row">
                  <h2 className="text-danger text-center pt-5">India COVID-19 Dashbord</h2>
                </div>
                <div className="row">
                    <div className="col-md-2">
                        <div className="card">
                            <h4> Country </h4>
                            h3.text
                        </div>
                    </div>
                </div>
            </section>

        </>
    )
}

export default Home;
